import './pageedit.css'
import QuillEditor from "react-quill";
import Logo from './assets/s_moreeee-removebg-preview.png'
const sections = [


];
const results = [

]
const pages = [
    'Chuck Hatton', 
    'Dumptruck Dylan',
    'Drawn Drawlson',
    'Micah\'s Man'
    
]
const curateResults = (soFar) => {
    console.log("Made it" + soFar)
    results.length = 0;
    let count = 0;
    for(let i = 0; i < pages.length; i++){
        if(pages[i].substring(0, soFar.length) === soFar){
            results.push(
                <div key={count}>
                    {pages[i]}
                </div>
            )
            count++;
        }
        if(count === 5){
            break;
        }
    }
    
}


function Pageedit() {
    const [data2, setdata2] = useState('Not Updated');
    

    return (
    <div className='All'>
        
        <div className='content'>
            
            <form>
                <textarea className='editor' rows='10' cols={window.innerWidth / 15} style={{display: (data2 != "Not Updated"? "inline-block" : "none")}} value={data2} onChange={(event) => setdata2(event.target.value)}>
                    
                </textarea>
            </form>
        </div>
    </div>
  )
}

export default Pageedit
